import React from 'react';
import './App.css';
import Main from './Pages/MainPage';
import {BrowserRouter, Router, Route} from 'react-router-dom'
import Beeline from './Pages/BeelinePage';


function App() {
  return (
    <BrowserRouter>
    <div>
      <Route exact path= "/" component= {Main} />
      <Route path= "/Form/3" component= {Beeline} />
    </div>
    </BrowserRouter>
  );
}

export default App;
